import React, { useEffect, useState } from 'react';
import LeftMenu from '../common/LeftMenu';
import Pagination from '../common/Pagination';
import SearchSection from './SearchSection';
import AssetsTableSection from './AssetsTableSection';
import useAxiosApi from '../../hooks/useAxiosApi';
import { t, getLang, onLangChange } from '../../translation';

// 가데이터
const MOCK_SELL_DATA = {
  data: {
    list: [
      {
        marketNo: 1,
        marketAssetName: '췌장암 Imputation 데이터 (국립암센터)',
        thumbnailFirst: 'https://via.placeholder.com/150',
        metaverseName: '없음',
        state: '2',
        stateDesc: '판매중',
      },
      {
        marketNo: 2,
        marketAssetName: '심장질환 환자 데이터셋',
        thumbnailFirst: 'https://via.placeholder.com/150',
        metaverseName: '없음',
        state: '2',
        stateDesc: '판매중',
      },
      {
        marketNo: 3,
        marketAssetName: '당뇨병 진단 데이터 API',
        thumbnailFirst: 'https://via.placeholder.com/150',
        metaverseName: '없음',
        state: 'S2',
        stateDesc: '제공중',
      },
      {
        marketNo: 4,
        marketAssetName: '건강검진 빅데이터 패키지',
        thumbnailFirst: 'https://via.placeholder.com/150',
        metaverseName: '없음',
        state: '1',
        stateDesc: '판매전',
      },
      {
        marketNo: 5,
        marketAssetName: '의료 영상 AI 학습 데이터',
        thumbnailFirst: 'https://via.placeholder.com/150',
        metaverseName: '없음',
        state: '5',
        stateDesc: '판매완료',
      },
      {
        marketNo: 6,
        marketAssetName: '보건의료 빅데이터 분석 서비스',
        thumbnailFirst: 'https://via.placeholder.com/150',
        metaverseName: '없음',
        state: 'S3',
        stateDesc: '제공중지',
      },
      {
        marketNo: 7,
        marketAssetName: '암 환자 생존율 분석 데이터',
        thumbnailFirst: 'https://via.placeholder.com/150',
        metaverseName: '없음',
        state: '2',
        stateDesc: '판매중',
      },
      {
        marketNo: 8,
        marketAssetName: '임상시험 데이터셋',
        thumbnailFirst: 'https://via.placeholder.com/150',
        metaverseName: '없음',
        state: '4',
        stateDesc: '판매종료',
      },
    ],
    totalPage: 1,
  },
};

const MarketSellAssetsContainer = () => {
  const [searchCondition, setSearchCondition] = useState({
    startDttm: '',
    endDttm: '',
    state: '',
    word: '',
  });

  const [currentSellPage, setCurrentSellPage] = useState(1);
  const [sellData, setSellData] = useState(null);
  const [isSellingLoading, setIsSellingLoading] = useState(false);

  const buildQueryParams = () => {
    const params = new URLSearchParams();
    Object.keys(searchCondition).forEach(key => {
      if (searchCondition[key]) {
        params.append(key, searchCondition[key]);
      }
    });
    params.append('pageNo', currentSellPage);
    return params.toString();
  };

  const queryParams = buildQueryParams();
  const endpoint = `/market/mypage${queryParams ? `?${queryParams}` : ''}`;
  const { execute: fetchMyAssets } = useAxiosApi(endpoint, 'GET');

  useEffect(() => {
    const fetchData = async () => {
      try {
        setIsSellingLoading(true);
        // 가데이터 사용 (개발용)
        const USE_MOCK_DATA = true; // false로 변경하면 실제 API 호출

        if (USE_MOCK_DATA) {
          // 검색 조건에 따라 필터링된 가데이터 반환
          await new Promise(resolve => setTimeout(resolve, 500)); // 로딩 시뮬레이션

          let filteredList = [...MOCK_SELL_DATA.data.list];

          // 검색어 필터링
          if (searchCondition.word) {
            filteredList = filteredList.filter(item =>
              item.marketAssetName.toLowerCase().includes(searchCondition.word.toLowerCase())
            );
          }

          // 상태 필터링
          if (searchCondition.state) {
            filteredList = filteredList.filter(item => item.state === searchCondition.state);
          }

          setSellData({
            data: {
              list: filteredList,
              totalPage: 1,
            },
          });
        } else {
          // 실제 API 호출
          const data = await fetchMyAssets();
          setSellData(data);
        }
      } catch (err) {
        console.error('판매 에셋 데이터 가져오기 에러:', err.message);
        // 에러 발생 시에도 가데이터 표시
        setSellData(MOCK_SELL_DATA);
      } finally {
        setIsSellingLoading(false);
      }
    };

    fetchData();
  }, [searchCondition, currentSellPage]);

  const handleSearchChange = condition => {
    setSearchCondition(condition);
    setCurrentSellPage(1);
  };

  const [lang, setLangState] = useState(getLang());
  useEffect(() => {
    const off = onLangChange(() => setLangState(getLang()));
    return off;
  }, []);

  return (
    <>
      <main>
        <section className="flex justify-center mt-16">
          <LeftMenu pageName="mypage" />
          <section className="flex-1 ml-4 max-w-screen-lg">
            <div className="flex justify-between">
              <h2 className="text-2xl mb-5">{t('page.mypage.marketSell.title')}</h2>
            </div>

            <SearchSection onSearch={handleSearchChange} />

            <AssetsTableSection
              data={sellData?.data?.list || []}
              isLoading={isSellingLoading}
            />
            <Pagination
              currentPage={currentSellPage}
              totalPage={sellData?.data?.totalPage || 0}
              onPageChange={setCurrentSellPage}
            />
          </section>
        </section>
      </main>
    </>
  );
};

export default MarketSellAssetsContainer;
